import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import SignupForm from './SignupForm';
import './App.css';

// Create a separate component for the Home page to use navigate hook
const HomePage = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const navigate = useNavigate();
  
  const navItems = [
    { name: 'Home', path: '/' },
    { name: 'Services', path: '/services' },
    { name: 'Find Jobs', path: '/jobs' },
    { name: 'Providers', path: '/providers' },
    { name: 'Employers', path: '/employers' },
    { name: 'About', path: '/about' },
    { name: 'Contact', path: '/contact' },
  ];

  const popularServices = [
    { name: 'Tension Footers', icon: '‚öíÔ∏è', category: 'Construction' },
    { name: 'Purchase', icon: 'üõí', category: 'Retail' },
    { name: 'Washout', icon: 'üíß', category: 'Cleaning' },
    { name: 'Gas Type', icon: '‚õΩ', category: 'Automotive' },
    { name: 'Employer', icon: 'üíº', category: 'Recruitment' },
    { name: 'Care Care', icon: 'üè•', category: 'Healthcare' },
    { name: 'S&P-West', icon: 'üè¢', category: 'Business Services' },
    { name: 'Business & Home', icon: 'üè†', category: 'Real Estate' },
  ];

  const providers = [
    { name: 'John Smith', address: '123 Main Street', city: 'New York', rating: 4.8 },
    { name: 'City Builders Inc.', address: '456 Oak Avenue', city: 'Chicago', rating: 4.5 },
    { name: 'Quick Clean Services', address: '789 Pine Road', city: 'Los Angeles', rating: 4.9 },
    { name: 'Auto Care Masters', address: '321 Maple Drive', city: 'Houston', rating: 4.7 },
  ];

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      console.log('Searching for:', searchQuery);
      // Implement search functionality here
    }
  };

  const handleGetStarted = () => {
    console.log('Get Started clicked');
    navigate('/signup');
  };

  const handleContactUs = () => {
    console.log('Contacting via: 1234567890');
    // Implement contact functionality
  };

  const handleLogin = () => {
    console.log('Login clicked');
    // You can also navigate to login page if you have one
  };

  const handleSignUp = () => {
    console.log('Sign Up clicked - navigating to signup page');
    navigate('/signup');
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className="app-container">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="nav-container">
          {/* Logo - Link to home */}
          <Link to="/" className="logo-link">
            <div className="logo">
              <span className="logo-icon">üë®‚Äçüíº</span>
              <span className="logo-text">KAMAU NEPAL</span>
            </div>
          </Link>

          {/* Desktop Navigation */}
          <div className="nav-items">
            {navItems.map((item, index) => (
              <Link key={index} to={item.path} className="nav-link">
                {item.name}
              </Link>
            ))}
          </div>

          {/* Auth Buttons */}
          <div className="nav-buttons">
            <button className="btn-login" onClick={handleLogin}>Login</button>
            <button className="btn-signup" onClick={handleSignUp}>Sign Up</button>
          </div>

          {/* Mobile Menu Button */}
          <button className="menu-toggle" onClick={toggleMenu}>
            {isMenuOpen ? '‚úï' : '‚ò∞'}
          </button>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <div className="mobile-nav">
            {navItems.map((item, index) => (
              <Link 
                key={index} 
                to={item.path} 
                className="mobile-nav-link" 
                onClick={toggleMenu}
              >
                {item.name}
              </Link>
            ))}
            <div className="mobile-auth">
              <button className="btn-login" onClick={handleLogin}>Login</button>
              <button className="btn-signup" onClick={handleSignUp}>Sign Up</button>
            </div>
          </div>
        )}
      </nav>

      {/* Header Section */}
      <header className="header">
        <div className="header-content">
          <h1 className="main-title">
            Find Employees And Service Providers Near Your City
          </h1>
          
          <form className="search-form" onSubmit={handleSearch}>
            <div className="search-box">
              <input
                type="text"
                placeholder="Search Service Providers and Employees near..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="search-input"
              />
              <button type="submit" className="search-button">
                üîç Search
              </button>
            </div>
            <div className="search-tips">
              <span className="search-tip">Try: "Plumber", "Developer", "Cleaner"</span>
            </div>
          </form>
        </div>
      </header>

      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-left">
          <h2 className="hero-title">Explore Your Skills!!!</h2>
          <p className="hero-subtitle">Companies Are Searching For You?</p>
          <button className="cta-button" onClick={handleGetStarted}>
            Get Started
          </button>
          <div className="hero-stats">
            <div className="stat">
              <span className="stat-number">10K+</span>
              <span className="stat-label">Jobs Available</span>
            </div>
            <div className="stat">
              <span className="stat-number">5K+</span>
              <span className="stat-label">Service Providers</span>
            </div>
            <div className="stat">
              <span className="stat-number">500+</span>
              <span className="stat-label">Companies Hiring</span>
            </div>
          </div>
        </div>
        
        <div className="hero-right">
          <div className="hire-card">
            <h3 className="hire-title">We Want To Hire You</h3>
            <p className="hire-description">Post your skills and get hired by top companies</p>
            <button className="contact-button" onClick={handleContactUs}>
              üìû Contact Us: 1234567890
            </button>
            <div className="verified-badge">
              <span className="verified-icon">‚úì</span>
              <span>Verified Employers</span>
            </div>
          </div>
        </div>
      </section>

      {/* Popular Services Section */}
      <section className="services-section">
        <div className="section-header">
          <h2 className="section-title">Popular Services</h2>
          <Link to="/services" className="view-all">View All ‚Üí</Link>
        </div>
        <div className="services-grid">
          {popularServices.map((service, index) => (
            <div key={index} className="service-card">
              <div className="service-icon">{service.icon}</div>
              <div className="service-content">
                <h3 className="service-name">{service.name}</h3>
                <span className="service-category">{service.category}</span>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Service Providers Section */}
      <section className="providers-section">
        <div className="section-header">
          <h2 className="section-title">Top Service Providers</h2>
          <Link to="/providers" className="view-all">View All ‚Üí</Link>
        </div>
        <div className="providers-grid">
          {providers.map((provider, index) => (
            <div key={index} className="provider-card">
              <div className="provider-header">
                <div className="provider-avatar">
                  {provider.name.charAt(0)}
                </div>
                <div className="provider-info">
                  <h3 className="provider-name">{provider.name}</h3>
                  <div className="provider-rating">
                    {'‚òÖ'.repeat(Math.floor(provider.rating))}
                    {'‚òÜ'.repeat(5 - Math.floor(provider.rating))}
                    <span className="rating-number">({provider.rating})</span>
                  </div>
                </div>
              </div>
              <div className="provider-details">
                <div className="detail-item">
                  <span className="detail-icon">üìç</span>
                  <span>{provider.address}</span>
                </div>
                <div className="detail-item">
                  <span className="detail-icon">üèôÔ∏è</span>
                  <span>{provider.city}</span>
                </div>
              </div>
              <button className="btn-hire">Hire Now</button>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-content">
          <div className="footer-section">
            <div className="logo">
              <span className="logo-icon">üë®‚Äçüíº</span>
              <span className="logo-text">KAMAU NEPAL</span>
            </div>
            <p className="footer-description">
              Connecting skilled professionals with opportunities and businesses with the right talent.
            </p>
          </div>
          
          <div className="footer-links-container">
            <div className="footer-links-group">
              <h4>For Job Seekers</h4>
              <Link to="/jobs" className="footer-link">Find Jobs</Link>
              <Link to="/companies" className="footer-link">Browse Companies</Link>
              <Link to="/advice" className="footer-link">Career Advice</Link>
              <Link to="/resume" className="footer-link">Resume Builder</Link>
            </div>
            
            <div className="footer-links-group">
              <h4>For Employers</h4>
              <Link to="/post-job" className="footer-link">Post a Job</Link>
              <Link to="/candidates" className="footer-link">Find Candidates</Link>
              <Link to="/resources" className="footer-link">Employer Resources</Link>
              <Link to="/pricing" className="footer-link">Pricing</Link>
            </div>
            
            <div className="footer-links-group">
              <h4>Company</h4>
              <Link to="/about" className="footer-link">About Us</Link>
              <Link to="/careers" className="footer-link">Careers</Link>
              <Link to="/blog" className="footer-link">Blog</Link>
              <Link to="/press" className="footer-link">Press</Link>
            </div>
            
            <div className="footer-links-group">
              <h4>Legal</h4>
              <Link to="/privacy" className="footer-link">Privacy Policy</Link>
              <Link to="/terms" className="footer-link">Terms of Service</Link>
              <Link to="/cookies" className="footer-link">Cookie Policy</Link>
              <Link to="/privacy-global" className="footer-link">Global Privacy</Link>
              <Link to="/social-human" className="footer-link">Social & Human</Link>
            </div>
          </div>
        </div>
        
        <div className="footer-bottom">
          <div className="social-links">
            <a href="#" className="social-link">üìò</a>
            <a href="#" className="social-link">üê¶</a>
            <a href="#" className="social-link">üì∏</a>
            <a href="#" className="social-link">üíº</a>
          </div>
          <p className="copyright">¬© 2024 JobConnect. All rights reserved. | Contact: 1234567890</p>
        </div>
      </footer>
    </div>
  );
};

// Main App component with Router
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/signup" element={<SignupForm />} />
        {/* Add more routes as needed */}
        <Route path="*" element={<HomePage />} />
      </Routes>
    </Router>
  );
};

export default App;
